window.onload = function(){
    const selectCity = document.getElementById("city");
    const selectLocality= document.getElementById("locality");
    selectLocality.disabled = true;
    //add state value to the state select option
    data.cities.forEach((value)=>{
        selectCity.appendChild(createOption(value.city, value.city));
    });
    selectCity.addEventListener("change",function(e) {
        selectLocality.disabled = false;
        data.cities.forEach((detail,index)=>{
            if(detail.city==e.target.value){
                selectLocality.innerHTML ="";
                selectLocality.append(createOption("Select Locality",""));
                data.cities[index].locality.forEach((locality)=> {
                    selectLocality.append(createOption(locality,locality));
                });
            }
    });
    });
    // create new option tag with value
    function createOption(displayMember, valueMember){
        const newOption = document.createElement("option");
        newOption.value = valueMember;
        newOption.text = displayMember;
        return newOption;
    }
};











